import React, { Component } from "react";
import { Link } from "react-router-dom";
import faker from "faker";
import LoginForm from "./LoginForm";


class Nav extends Component {

    constructor(props) {
        super(props);

        this.state = {
            logo: faker.random.image(),
            loginButtonText: "Logga in",
            loginButtonClass: "",
            showLogin: false,
        }
    }

    handleOnclickLogin = () => {
        if (this.state.showLogin) {
            return (this.setState({ loginButtonText: "Logga in", loginButtonClass: "hide", showLogin: false }));
        } else {
            return (this.setState({ loginButtonText: "...", loginButtonClass: "", showLogin: true }));
        }
    }

    handleSubmit = (event) => {
        event.preventDefault()
    }

    render() {
        return (

            <nav className={"top-menu"} >
                <ul>
                    <li>
                        <Link to="/">
                            <img src={this.state.logo} className={"nav-logo"} alt={"Logo"} />
                        </Link>
                    </li>
                    <li>
                        <Link to="/">
                            <button className={""}>Program</button>
                        </Link>
                    </li>
                    <li>
                        <Link to="/bookings">
                            <button className={""}>Bokningar</button>
                        </Link>
                    </li>
                    <li>
                        <form onSubmit={this.handleSubmit}>
                            <button className={this.state.loginButtonClass} onClick={this.handleOnclickLogin}>{this.state.loginButtonText}</button>
                        </form>
                        <LoginForm showClass={this.state.showLogin} />
                    </li>
                </ul>
            </nav >

        )
    }
}

export default Nav;
